import { Outlet, Route, Routes } from 'react-router-dom'

import StartAdventureLayout from '~app/start-adventure.../layout'
import StartAdventure from '~app/start-adventure.../page'

import NotFound from '~components/common/NotFound'

function StartAdventureSubRouter() {
  return (
    <Routes>
      <Route
        path=""
        element={<StartAdventureLayout><Outlet /></StartAdventureLayout>}
      >
        <Route
          index
          element={<StartAdventure />}
        />
        <Route
          path="*"
          element={<NotFound />}
        />
      </Route>
    </Routes>
  )
}

export default StartAdventureSubRouter
